export const styles = theme => ({
    trip: {
        alignItems: "center",
        display: "flex",
        justifyContent: "space-between",
    },
    rate: { display: "flex" },
    label: {
        display: "flex",
        flexDirection: "column",
        marginLeft: theme.spacing(1),
    },
});
